import React from 'react';
import { Row } from "reactstrap";


function Products() {
  return (
    <div>
      <Row>
      <h1><span class="badge bg-secondary" style={{width: "250px", height: "250px"}}>Urun Ekle</span></h1>
      <h1><span class="badge bg-secondary" style={{width: "250px", height: "250px"}}>Urun Cikar</span></h1>
      <h1><span class="badge bg-secondary" style={{width: "250px", height: "250px"}}>Urun Guncelle</span></h1>
      </Row>
    </div>
  );
}

export default Products;
